import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import GreetForm from "./GreetForm";
import "../css/Page.css";

function Header() {
    return (
        // <header className="PageHeader">
            <div className="HeaderNav">
                <div style={{ display  : 'flex' }}></div>
                <nav>
                    <ul>
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/other">Other Subpage</Link>
                        </li>
                    </ul>
                </nav>
            </div>
        // </header>
    );
}

function Footer() {
    return <footer className="PageFooter">Footer content here</footer>;
}

function OtherComponent() {
    return <div>This is another subpage content.</div>;
}

function Page() {
    return (
        <Router>
            <div className="Page">
                <div className="PageHeader"><Header /></div>
                <div className="PageContent">
                    <Routes>
                        <Route path="/" element={<GreetForm />} />
                        <Route path="/other" element={<OtherComponent />} />
                    </Routes>
                </div>
                <div className="PageFooter">
                    <Footer />
                </div>
            </div>
        </Router>
    );
}

export default Page;
